import './MovieDetail.css';

export default function MovieDetail(props){
  return (
    <div className="movie-detail">
      <div className="year">{props.movie.releasedYear}</div>
      <div className="minutes">{props.movie.minutes}</div>
      <div className="rate">{props.movie.rate}</div>
      <h2 className="title">{props.movie.name}</h2>
      <div className="desc">{props.movie.description}</div>
      <div>{props.movie.genres.length}</div>
      <div><img src={require(`../../images/${props.movie.imgUrl}`)} alt="movie-pic" /></div>
    </div>
  )
}
